package com.ada.model.view;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Transient;@Entitypublic class TransByDayView {    @Id    @Column(name = "genDate")    private String genDate;    @Transient    private int totalTransSuccess;    @Column(name = "totalAmount")    private Long totalAmount;    @Column(name = "ospValue")    private Long ospValue;    @Column(name = "shareValue")    private Long shareValue;    public String getGenDate() {        return genDate;    }    public void setGenDate(String genDate) {        this.genDate = genDate;    }    public int getTotalTransSuccess() {        return totalTransSuccess;    }    public void setTotalTransSuccess(int totalTransSuccess) {        this.totalTransSuccess = totalTransSuccess;    }    public Long getTotalAmount() {        return totalAmount;    }    public void setTotalAmount(Long totalAmount) {        this.totalAmount = totalAmount;    }    public Long getOspValue() {        return ospValue;    }    public void setOspValue(Long ospValue) {        this.ospValue = ospValue;    }    public Long getShareValue() {        return shareValue;    }    public void setShareValue(Long shareValue) {        this.shareValue = shareValue;    }}